                      <th>Last Name</th>
                      <th>Mobile No.</th>
                      <th>Password</th>
                      <th>Actions</th>
                    </tr>
                  </thead>
                  <tbody>

                  </tbody>
                </table>
    </div>
  )
}

export default Dashboard
